import React from 'react';

const Sidebar = () => {

  const [isOpen, setIsOpen] = useState(false);

  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };



  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <a className="centrar-logo" href="/">
            <img className="logo" src="/img/logo-iciamex.png" alt="ICIAMEX logo" />
        </a>
      </div>
      <nav id="primary-menu" className="navbar">
        <div className="container">
          <div className="navbar-header">
            <button type="button" className="navbar-toggle collapsed" data-toggle="collapse" data-target="#navbar-collapse-1" aria-expanded="false">
              <span className="sr-only">Toggle navigation</span>
              <span className="icon-bar"></span>
              <span className="icon-bar"></span>
              <span className="icon-bar"></span>
            </button>
          </div>
          <div className="collapse navbar-collapse" id="navbar-collapse-1">
            <ul className="nav navbar-nav">
              <li><a className="active" href="index.html">Home</a></li>
              <li><a href="page-about-us-2.html">Pages</a></li>
              <li><a href="blog-carousel-2.html">Blog</a></li>
              <li><a href="portfolio-standard-2cols-2.html">Portfolio</a></li>
              <li><a href="shop-3columns-2.html">Shop</a></li>
              <li><a href="slider-12.html">Feature</a></li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="sidebar-footer">
        <div className="sidebar-copyright">&copy; 2024 ICIAMEX</div>
      </div>
    </div>
  );
};

export default Sidebar;
